Voici une fonction C++ qui convertit du texte formatté Markdown en HTML :

```cpp
#include <iostream>
#include <string>
#include <regex>

std::string markdownToHtml(const std::string& markdown) {
    std::string html;

    // Champs 1 : Títres
    html += markdown;

    // Champs 2 : Gras
    html = std::regex_replace(html, std::regex("^### (.*?)$"), "<b>$1</b>");
    html = std::regex_replace(html, std::regex("^## (.*?)$"), "<strong>$1</strong>");
    html = std::regex_replace(html, std::regex("^# (.*?)$"), "<h1>$1</h1>");

    // Champs 3 : Italique
    html = std::regex_replace(html, std::regex("\\*\\*(.*?)\\*\\*"), "<i>$1</i>");

    // Champs 4 : Lignes blanches
    html = std::regex_replace(html, std::regex("^\\\\n$", "\n");

    // Champs 5 : Liens
    html = std::regex_replace(html, std::regex("\\[(.*?)\\]\\((.*?)\\)"), "<a href=\"$2\">$1</a>");

    // Champs 6 : Listes non numérotées
    html = std::regex_replace(html, std::regex("^- (.*?)$"), "<li>$1</li>");
    html = std::regex_replace(html, std::regex("^  - (.*?)$", "</ul>\n<ul>\n  <li>$1</li>");
    html = std::regex_replace(html, std::regex("^  - (.*?)$"), "<ul><li>$1</li>");

    // Champs 7 : Bascule
    html = std::regex_replace(html, std::regex("^~~(.*?)~~$"), "<s>$1</s>");

    // Champs 8 : Images
    html = std::regex_replace(html, std::regex("\\!(.*?)\\((.*?)\\)$"), "<img src=\"$2\" alt=\"$1\">");

    return html;
}

int main() {
    std::string markdown = "# Titre\n## Sujet\n### Sous-sujet\n*Ce texte est en italique*\n[Liens](https://www.example.com)\n\n- Premier élément\n- Deuxième élément\n\nCe texte est barré : ~~Ceci est barré~~\n\n![Image](https://www.example.com/image.jpg)";
    std::cout << markdownToHtml(markdown) << std::endl;
    return 0;
}
```

Ce code utilise les fonctions de la bibliothèque de manipulation de chaînes de caractères de C++ pour effectuer la conversion. La fonction `markdownToHtml` prend en entrée une chaîne de caractères contenant du texte formatté Markdown et retourne une chaîne de caractères contenant le texte converti en HTML. Les expressions régulières sont utilisées pour trouver les différents formats Markdown et les remplacer par leur équivalent en HTML.

Dans le code `main`, on utilise la fonction `markdownToHtml` pour convertir un exemple de texte Markdown en HTML, qui est ensuite affiché à l'écran.

