**Code:**

```c
#include <SDL2/SDL.h>
#include <SDL2/SDL_image.h>
#include <stdio.h>
#include <stdlib.h>

// Define constants
#define SCREEN_WIDTH 800
#define SCREEN_HEIGHT 600
#define FPS 60

// Define color constants
SDL_Color black = {0, 0, 0};
SDL_Color white = {255, 255, 255};

// Define game variables
SDL_Window* window;
SDL_Renderer* renderer;
SDL_Texture* backgroundTexture;
SDL_Texture* snakeTexture;
SDL_Texture* foodTexture;
SDL_Rect snakeRect;
SDL_Rect foodRect;
SDL_Rect backgroundRect;
int snakeX = 0;
int snakeY = 0;
int foodX = 0;
int foodY = 0;
int score = 0;
int direction = 0; // 0: up, 1: down, 2: left, 3: right
int speed = 10;

void initSDL() {
    // Initialize SDL
    SDL_Init(SDL_INIT_VIDEO);
    // Create window
    window = SDL_CreateWindow("Snake Game", SDL_WINDOWPOS_CENTERED, SDL_WINDOWPOS_CENTERED, SCREEN_WIDTH, SCREEN_HEIGHT, SDL_WINDOW_SHOWN);
    if (!window) {
        printf("Failed to create window: %s\n", SDL_GetError());
        exit(1);
    }
    // Create renderer
    renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED);
    if (!renderer) {
        printf("Failed to create renderer: %s\n", SDL_GetError());
        exit(1);
    }
}

void loadTextures() {
    // Load background texture
    backgroundTexture = IMG_LoadTexture(renderer, "background.png");
    if (!backgroundTexture) {
        printf("Failed to load background texture: %s\n", SDL_GetError());
        exit(1);
    }
    // Load snake texture
    snakeTexture = IMG_LoadTexture(renderer, "snake.png");
    if (!snakeTexture) {
        printf("Failed to load snake texture: %s\n", SDL_GetError());
        exit(1);
    }
    // Load food texture
    foodTexture = IMG_LoadTexture(renderer, "food.png");
    if (!foodTexture) {
        printf("Failed to load food texture: %s\n", SDL_GetError());
        exit(1);
    }
}

void update() {
    // Move snake
    if (direction == 0) {
        snakeY -= speed;
    } else if (direction == 1) {
        snakeY += speed;
    } else if (direction == 2) {
        snakeX -= speed;
    } else if (direction == 3) {
        snakeX += speed;
    }
    // Check collision with border
    if (snakeX < 0 || snakeX > SCREEN_WIDTH - 32 || snakeY < 0 || snakeY > SCREEN_HEIGHT - 32) {
        printf("Game over!\n");
        exit(1);
    }
    // Check collision with food
    if (snakeX == foodX && snakeY == foodY) {
        // Increase score and generate new food
        score++;
        foodX = rand() % (SCREEN_WIDTH / 32) * 32;
        foodY = rand() % (SCREEN_HEIGHT / 32) * 32;
    }
}

void render() {
    // Clear screen
    SDL_SetRenderDrawColor(renderer, 0, 0, 0, 255);
    SDL_RenderClear(renderer);
    // Draw background
    SDL_RenderCopy(renderer, backgroundTexture, NULL, &backgroundRect);
    // Draw snake
    SDL_Rect snakeRect = {snakeX, snakeY, 32, 32};
    SDL_RenderCopy(renderer, snakeTexture, NULL, &snakeRect);
    // Draw food
    SDL_Rect foodRect = {foodX, foodY, 32, 32};
    SDL_RenderCopy(renderer, foodTexture, NULL, &foodRect);
    // Update screen
    SDL_RenderPresent(renderer);
}

int main() {
